import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="navbar">
        <div className="navbar-sub">
          <a href="" className="nav-item">Projects</a>
          <a href="" className="nav-item">Articles</a>
          <a href="" className="nav-item">About</a>
        </div>
      </div>
    </div>
  );
}

export default App;
